  `user_religion_name` varchar(50) NOT NULL COMMENT 'ชื่อศาสนา',
  `user_status_id` int(10) NOT NULL COMMENT 'idสถานะภาพ',
  `user_status_name` varchar(50) NOT NULL COMMENT 'ชื่อสถานะภาพ',
  `user_domicile_id` int(10) NOT NULL COMMENT 'idภูมิลำเนา',
