  `user_start_work_name` varchar(100) NOT NULL,
  `user_login` varchar(100) NOT NULL,
  `user_password` varchar(255) NOT NULL,
  `RFID_code` text,
  `user_id_status` int(10) NOT NULL COMMENT 'idสถานะผู้ใช้งาน',
  `user_name_status` varchar(50) NOT NULL COMMENT 'ชื่อสถานะผู้ใช้งาน',
  `user_note` text NOT NULL COMMENT 'หมายเหตุ',
  `created_user_id` int(10) NOT NULL,
  `created_user` varchar(50) NOT NULL,
  `created_date` datetime NOT NULL,
  `updated_user_id` int(10) NOT NULL,
  `updated_user` varchar(50) NOT NULL,
  `updated_date` datetime NOT NULL,
  PRIMARY KEY (`user_id`)
